/**
 * Genera arte ASCII per il testo specificato utilizzando uno stile ASCII specifico.
 *
 * @param text  Il testo da rappresentare in arte ASCII.
 * @param style Lo stile ASCII da utilizzare per la generazione dell'arte.
 * @return Una stringa contenente l'arte ASCII generata per il testo specificato e lo stile specifico.
 */
    public static String generate(String text, ASCII_STYLE style) {

        HashMap<String, byte[]> hastTable = table.get(style);
        

        //conto quante linee e colonne ho
        byte[] charData = hastTable.get(" ");
        //System.out.println(text);
        int line = 1;
        int column = 0;

        for (int i = 0; i < charData.length; i++) {
            if (charData[i] == 0xa)
                line++;
        }

        for(int ch = 0; ch < text.length(); ch++)  
        {
            charData = table.get(style).get(new StringBuilder().append(text.charAt(ch)).toString());
            for (int i = 0; i < charData.length; i++) {
                if (charData[i] != 0xa)
                    column++;
            }
        }

        //dispongo gli elementi
        byte[][] template = new byte[line][column];
        int offset = 0;

        for(int ch = 0; ch < text.length(); ch++) 
        {
            int row = 0;
            int col = 0;

            charData = table.get(style).get(new StringBuilder().append(text.charAt(ch)).toString());
            //System.out.println("lenght: " + charData.length);

            for(int i = 0; i < charData.length; i++) {
                //System.out.println("[row: " + row + " col:" + col + " i: " + i+ " pos: " + (offset + col) + "]");
                if (style == ASCII_STYLE.BIG_SMUSHING && i == 0) {
                    i++;
                }  
                
                if (charData[i] == 0xa) {
                    row++;
                    col = 0;
                    
                    if (style == ASCII_STYLE.BIG_SMUSHING) {
                        i++;
                    } 
                }  
                else {
                    if(style == ASCII_STYLE.BIG_SMUSHING && template[row][offset + col] >= 33 && charData[i] == 32) {
                        col++;
                        continue;
                    }
                        
                    template[row][offset + col++] = charData[i];
                }
            }
            if (style == ASCII_STYLE.BIG_SMUSHING) 
                offset += col - 1;
            else
                offset += col;
        }

        //trasformo la matrice ""template"" in una stringa
        StringBuilder sb = new StringBuilder();
       
        for (int i = 0; i < template.length; i++) {
            for (int j = 0; j < template[i].length; j++) {
                sb.append((char)template[i][j]);
            }
            sb.append("\n");
        }
        return sb.toString();
    }
